description:
My dog Gizmo has been diagnosed with Necrotizing encephalitis in  january 2011.  

The video you are about to see is  following 2 treatments of Lomustin and Prodnisone 1mg every two days.

Refusing to pursue the traditional treatment I have decided to use natural healing through  foods rich in antioxidants and chlorophyll.

Below is the list of natural supplements and food that Gizmo has been eating;
Organic meat;
Carrots;
Veggies;
Lentils;
Chlorella;
Spiruline;
L-Glutamine;
Vitamin C (L-ascorbs);
Omega 3's
And sea weed.

The New Hartford Police is attempting to identify the three females pictured in this video related to a larceny investigation.  If anyone can identify any of the females pictured in the video please contact the New Hartford Police at 315-733-6666 or 315-724-7111.  All calls will remain confidential.

